def jpg_to_base64(img_path):
    try:
        with open(img_path, 'rb') as image_file:
            base64_bytes = base64.b64encode(image_file.read())
            base64_string = base64_bytes.decode()
            return base64_string
    except Exception as e:
        print(f"Error encoding {img_path}: {e}")
        return None

# Split requests between batches
max_requests_per_file = 53 # Batches are max 100MB
batch_index = 1
current_request_count = 0

for folder in folders:
    folder_name = folder.split('/')[-1]
    id_suffix = folder_name.split('_')[-1]
    
    try:
        files = [f for f in os.listdir(folder) if os.path.isfile(os.path.join(folder, f))]
        
        image_files = [f for f in files if f.lower().endswith(('.png', '.jpg', '.jpeg'))]
        
        already_seen_images = set()
        for n in range(100):
            if image_files:
                # Get a random image in the folder
                
                random_image = random.choice(image_files)

                while random_image in already_seen_images:
                    random_image = random.choice(image_files)

                already_seen_images.add(random_image)

                id_prefix = random_image.split('.')[0]

                # Get base64 version
                image_path = os.path.join(folder, random_image)
                image_b64 = jpg_to_base64(image_path)

                # Compile unique ID
                request_id = id_prefix + "_" + id_suffix
                
                if current_request_count >= max_requests_per_file:
                    batch_index += 1
                    current_request_count = 0

                add_to_batch(request_id, image_b64, batch_index)
                current_request_count += 1
            else:
                print(f"No images found in {folder}")
    except Exception as e:
        print(f"Error accessing {folder}: {e}")
